import React from 'react';

const CardComponent = ({ flight }) => {
  return (
    <div className="card" style={{ width: '18rem', margin: '8px' }}>
      <div className="card-body">
        <h5 className="card-title">{flight.airline}</h5>
        <p className="card-text">
          Flight ID: {flight.flight_id}<br />
          Source: {flight.source}<br />
          Destination: {flight.destination}<br />
          Departure: {new Date(flight.departure_time).toLocaleString()}<br />
          Arrival: {new Date(flight.arrival_time).toLocaleString()}
        </p>
      </div>
    </div>
  );
};

export default CardComponent;
